  false,\n\t\"url\": null,\n\t\"notes\": \"The Mourning Dove (Zenaida macroura) Call-Count
  Survey was developed to provide an index to population size and to detect annual
  changes in mourning dove breeding populations in the U.S. The survey consisted of
  numerous routes throughout the U.S., which were surveyed in late May and early June.
  The resulting estimates of relative abundance and population trends comprised the
  principal information used in the annual setting of mourning dove hunting seasons.
  These data could also be used to examine the effects of weather, landscape change,
  and other factors on mourning dove population abundance.\",\n\t\"license_title\":
